INSERT INTO `tp_img` VALUES ('11078', '6', 'user', '中国家庭医生：阿司匹林，防心脑血管意外的良药', '2', '众所周知，心脑血管病是人类的头号杀手，全世界每年死于心脑血管病的人超过1700万，我国每15秒就有1人被心脑血管病夺去生命！', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f3c8e04a7.jpg', '1', '<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	拯救心脑血管，阿司匹林很给力&nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	众所周知，心脑血管病是人类的头号杀手，全世界每年死于心脑血管病的人超过1700万，我国每15秒就有1人被心脑血管病夺去生命！ &nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	这些心脑血管事件的根源是，动脉粥样硬化斑块破裂和血栓形成，导致血管闭塞、血流不通，引起相应脏器缺血、坏死。 &nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	若发生在供血心脏的冠状动脉，即表现为不稳定性心绞痛和/或急性心肌梗死，甚至猝死；若发生在脑部，就是急性缺血性中风。 &nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	可见，血栓形成在心脑血管事件中扮演了极不光彩的重要角色，而这一切都与血小板的不寻常聚集息息相关。 &nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	要想预防心脑血管意外，抗血小板聚集、减少血栓发生势必成为关键。于是，具有强烈抗血小板聚集功能的老药——阿司匹林，再次获得临床关注，被广泛用于心脑血管病的预防体系中。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	小剂量，肠溶片最合适&nbsp;&nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	需要提醒注意的是，小剂量阿司匹林便足以抑制血小板的聚集，达到预防心脑血管病的目的；大剂量不仅不能增加疗效，反而会增加毒副反应。鉴于此，国内一般推荐用量为100毫克/日。 &nbsp; 剂型上，建议最好采用肠溶片，以减少对胃黏膜的刺激，且阿司匹林主要在小肠上段吸收，肠溶片吸收慢，作用达24小时，抑制血小板作用更可长达2~7天。 &nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	话虽如此，却不意味着2~3天服一次即可，因为血小板每日更新10%，且不受前一天服用阿司匹林的影响。所以，必须每日预防性用药，并持之以恒。&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	出血概率很低&nbsp;&nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	服用阿司匹林，往往会担心消化道出血，其实这种概率是很低的。据统计，每1000例服用阿司匹林1年的病人中，仅有1例会出现消化道出血，且多发生在有出血倾向、溃疡病和中重度肝病者身上。针对此，可考虑合用胃黏膜保护剂和制酸药，以减少胃肠道出血。 &nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	但有活动性出血者，则不宜使用阿司匹林。至于对阿司匹林过敏、有禁忌、有严重不良反应，或对阿司匹林抵抗者，可考虑改用氯吡格雷等抗血小板药。 &nbsp;&nbsp;\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	最后必须指出，急性出血性脑中风者绝对不能使用阿司匹林。而高血压病人，一定要把血压控制好后方可使用。（编辑：姚文怡）\r\n</p>', '', '1414132715', '1414132715', '0', 'pjeupf1402729544', '中国家庭医生：阿司匹林，防心脑血管意外的良药', '2014-10-24', 'user');
INSERT INTO `tp_img` VALUES ('11079', '6', 'user', '喉癌主要发生在声带等部位', '2', '喉癌主要发生在3个部位，一个是声门区，长在声带上。这类喉癌若能早发现，仅做手术，效果非常好，术后五年生存率达到90%。目前，上海及周边地区的喉癌病例，70%以上都是声门区的，即长在声带上的。', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f43f01a64.jpg', '1', '<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	声门区喉癌 最常见\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	喉癌主要发生在3个部位，一个是声门区，长在声带上。这类喉癌若能早发现，仅做手术，效果非常好，术后五年生存率达到90%。目前，上海及周边地区的喉癌病例，70%以上都是声门区的，即长在声带上的。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	二是长在声门上区，一般发现比较晚，预后比较差，且转移比较早。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	三是长在声门下区，多数发现就是晚期了。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	判断期别时，主要看两个指标，一是看肿瘤所在位置，另一个是看肿瘤大小。此外，还可以看有没有淋巴结转移或远处转移。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	肿瘤分期是通过三个指标联合评估的，即TNM分期，其中T描述肿瘤局部大小，N描述肿瘤局部是否有淋巴结转移，M描述肿瘤是否有远处转移。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	如声门上型的喉癌，T1为早期，指肿瘤限于声门上一个亚区，声带活动正常。声门型喉癌，T1指肿瘤局限于声带，但声带活动正常。声门下型喉癌，T1指肿瘤限于声门下。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	一般，出现淋巴结或远处转移的，就是喉癌晚期了。像T4多是晚期。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	喉镜 快速筛查和辨别\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	如果老百姓发现自己声音突然哑了，应该到医院做一个喉镜。现在喉镜显露非常好，可以完整看到声带等正常结构，病变的大小、范围。有些喉镜下还能做染色，判断白斑等癌前病变。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	喉镜下可以按声带息肉进行切除，再做病理。如果报告良性的，就不用处理了。如果报告是恶性的，需要进一步诊断。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	喉癌首选手术治疗\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	喉癌是一个实体肿瘤，跟身体其他部位的肿瘤可能略有不同。如血液系统等肿瘤，以化疗为主；扁桃体下咽部肿瘤，放化疗的效果也很好。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	但喉癌由于解剖结构的特殊性，一旦发现，首选手术。只有在很早期病变的情况下，可以采用放疗，跟手术效果差不多。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	一般，早期声门区的喉癌仅做手术，效果就很好。T3以上需要加放疗。声门上区的喉癌一般都要手术加放疗。声门下区的患者要做全喉切除手术，术后需要综合治疗，如加放化疗。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	早期喉癌采用手术，治愈率高，超过90%，费用低。手术治疗早期喉癌治疗时间短，激光切除只需住院数天，喉部分切除术住院约半个月左右。其优点在于不会影响吃饭，对免疫功能无影响。但缺点在于，术后患者声音嘶哑明显。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	复发率来讲，早期癌的手术和放疗，效果都差不多。晚期喉癌，如T3、T4，术后五年生存率在50%，还有50%的患者在治疗后一年到两年间，容易复发，此后可以进一步手术。晚期喉癌患者不建议首选放疗。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	如果选择手术，手术种类很多，包括比较微创的切除术、激光切除和常规手术等。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	喉癌手术切口 因人而异\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	肿瘤较大者，可以做包括声带切除、水平半喉切除、垂直半喉切除在内的喉部分切除。如果病情更重，可以做全喉切除。做了全喉切除的患者有时会担心说话的问题，我们可以通过发音功能的重建、术后训练，帮助其发声。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	由于肿瘤位置的不同，手术切口的位置、大小等，会有很大区别。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	经典切口在环甲膜平面横切口、比甲状腺高一点的位置，做一个弧形切口；其次，可以做正中结构，从舌骨往下，垂直竖下来。全喉切除的话，做垂直切口比较好，感染概率比较低。早期喉癌声带裂开，也可以做垂直切口。\r\n</p>', '', '1414132810', '1414132810', '0', 'pjeupf1402729544', '喉癌主要发生在声带等部位', '2014-10-24', 'user');
INSERT INTO `tp_img` VALUES ('11080', '6', 'user', '60%的习惯性流产，和免疫因素相关', '2', '怀孕本是人生一大喜事，然而对于曾经接二连三发生过自然流产的女性来说，看到验孕试纸变成“中队长”（两条杠）时，心情却是复杂得很，有一半是喜悦，一半却是忐忑不安。', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f49984519.jpg', '1', '<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	怀孕本是人生一大喜事，然而对于曾经接二连三发生过自然流产的女性来说，看到验孕试纸变成“中队长”（两条杠）时，心情却是复杂得很，有一半是喜悦，一半却是忐忑不安。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	不安的原因，当然是担心这次的怀孕会否和以前一样，中途突然自行流产，保都保不住。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	这样的担心，显然不是多余的。事实上，习惯性流产在临床上很是常见。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	有过3次或3次以上在28周之前的自然流产，就被称为习惯性流产。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	说起习惯性流产的发生原因，张建平教授认为：“超过60%的习惯性流产是与免疫因素相关的。”\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	比起那些连发病原因都还没找到的疾病来说，显然，习惯性流产这个已经找到主要原因的疾病，其治疗并没有一般人想象中那么难。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	“通过各种免疫治疗，90%以上免疫相关引起的习惯性流产，患者最终能够成功妊娠。”张建平教授的一句话，带给大家极大的希望。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	正常情况下，外来异物入侵人体后，人体会发生一定的免疫反应，对该异物进行攻击和清除。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	不过，一般正常的怀孕过程中，妻子会对来自丈夫的基因抗原产生免疫耐受，告诉自己的免疫细胞，不要把它当成异物攻击排斥。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	这个过程，当然不是妻子用嘴巴说说就可以的，它依靠的还是妻子身体里的免疫反应。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	面对丈夫的基因抗原，妻子的身体就会产生一种保护性的因子（即封闭因子或封闭抗体），它能对丈夫的抗原进行修饰伪装。这相当于打了个印章，告诉妻子的免疫系统：这是自家人。这样一来，妻子身体里的免疫系统就不会对来自丈夫的基因进行打击。这样就不会发生免疫相关的流产。\r\n</p>\r\n<p style=\"text-indent:2em;color:#333333;font-family:宋体, tahoma, arial;font-size:14px;background-color:#FFFFFF;\">\r\n	发生免疫相关性流产的孕妇，往往就是因为孕妇无法对自己丈夫的基因抗原产生封闭因子。因此即便怀孕了，孕妇自身的免疫系统还是会不停地攻击含有丈夫基因的“外来物”，从而导致流产的发生。这就是最常见的同种免疫型流产。\r\n</p>', '', '1414132891', '1414132891', '0', 'pjeupf1402729544', '60%的习惯性流产，和免疫因素相关', '2014-10-24', 'user');
INSERT INTO `tp_img` VALUES ('11081', '6', 'user', '破解看病难应从“小处着手”', '2', '借助金融IC居民健康卡可以预约挂号、缴费支付，减少挂号和缴费时反复排队的麻烦;借助微信也可以直接在北京个别大医院挂号了……这两天，关于看病挂号新方式的新闻吸引不少人的关注。别小看这些细节上的小改变，它们可以让病人少许多不必要的折腾，正是宏大的医疗体制改革中不能忽视的小细节', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f4e405821.jpg', '1', '<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	借助金融IC居民<a href=\"http://healthplan.999120.net/\" target=\"_blank\">健康</a>卡可以<a href=\"http://order.999120.net/\" target=\"_blank\">预约挂号</a>、缴费支付，减少挂号和缴费时反复排队的麻烦;借助微信也可以直接在北京个别大医院挂号了……这两天，关于看病挂号新方式的新闻吸引不少人的关注。别小看这些细节上的小改变，它们可以让病人少许多不必要的折腾，正是宏大的医疗体制改革中不能忽视的小细节。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	“看病难”是百姓生活中的“老大难”。尤其是北京、上海等大城市的大医院，人山人海，往往一人看病、全家出动。而仔细分析，看病的时间大多用在排队挂号、排队候诊、排队缴费、排队检查、再排队看医生，再排队缴费、再排队取药等环节上，医生“望闻问切”的过程反倒是花费时间最短的。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	医改之所以难，难在很多问题动辄涉及机制体制根源，非一日之功能化解，非一方之力能奏效。但是，大部分病人感受到的“难”，有一些并不涉及体制机制。例如<a href=\"http://daoyi.999120.net/\" target=\"_blank\">导诊</a>不明晰，去错了科室只有从头再排队挂号;缴费制度不科学，要反复排队交钱;医院科室标识不清晰，病人往往满楼上下跑，苦不堪言。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	地方卫生主管部门当年曾经推出过“院长当一天患者”的活动。19家医院院长“扮成”普通患者，各自选择一家不熟悉的医院就诊。结果，每个院长都有一肚子“苦水”。而这些“苦水”并非全是涉及医改的体制机制问题，有一些是医院导医专业知识不够等看起来不起眼的小细节，给患者带来很多麻烦，这也是使病人对看病“发憷”的重要原因。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	近年来，医患冲突大多发生在大医院，而非基层医疗机构。其中一个重要原因就是大医院的就诊感受太差，容易产生不满情绪。要改变这些就诊小细节，就需要多建立一些畅通的挂号渠道，多挂几块指路的牌子，多加几个专业的导医台，建立一个更完善的结账系统。与医改这样的宏大改革相比，这种抓小细节的改变要容易得多，但是见效可能并不小。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	为破解“看病难、看病贵”，近些年国家坚持“保基本、强基层、建机制”的基本原则，推动医改取得一定的进步。但是，在抓大的同时，也不应当忽视医院服务的小细节。医院应当从小细节改起，改变服务理念和服务方式，尽量让患者能少排队、少费时、少折腾。\r\n</p>', '', '1414132965', '1414132965', '0', 'pjeupf1402729544', '破解看病难应从“小处着手”', '2014-10-24', 'user');
INSERT INTO `tp_img` VALUES ('11082', '6', 'user', '挂号网“已满”、“淘宝号”慎重，网上挂号该走向哪里？', '2', '挂号网作为挂号平台中的一员，经常出现号源已满的情况，这让很多患者不能挂到号，经几次挂号试验，热门医院的热门专家，均出现号源瞬间就被秒杀的情况。', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f5464099f.jpg', '1', '<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	挂号网作为挂号平台中的一员，经常出现号源已满的情况，这让很多患者不能挂到号，经几次挂号试验，热门医院的热门专家，均出现号源瞬间就被秒杀的情况。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	<img height=\"225\" alt=\"医院<a href=\'http://order.999120.net/\' target=_blank>预约挂号</a>\" width=\"300\" src=\"http://999120.net/news/photo_news/20140626145344.jpg\" />\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	&nbsp;&nbsp;&nbsp; 某市刘小姐全家守在挂号网上，抢挂华山医院某专家号，号源瞬间被秒杀。让她意外的是，淘宝上却有卖家抛售专家号，售价300元，忍痛挨宰一刀后，刘小姐收到了落款为挂号网的确认短信，并成功看上了该专家。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	&nbsp;&nbsp;&nbsp; 多家医院提醒市民，去医院就诊时，身份证信息原则上必须与预约时的身份信息完全一致方能挂号。从黄牛手中非正常途径购买的号，存在不能正常问诊的风险，一旦出现纠纷，市民将很难维权。面对这种挂号网“已满”、“淘宝号”慎重的情况，<a href=\"http://order.999120.net/\"></a><a href=\"http://order.999120.net/\" target=\"_blank\">网上挂号</a>该走向哪里？\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	&nbsp;&nbsp;&nbsp; 导医网（<a href=\"http://999120.net/\">http://999120.net</a>）作为挂号平台中的一员，坚持为患者解决挂号难的问题。导医网与全国多家医院有合作关系，为老百姓解决看病难，住院难等全方面问题。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	&nbsp;&nbsp;&nbsp; 导医网在此提醒广大患者，请勿盲目就医，挂号请选择正规的号源平台，谨防上当受骗。\r\n</p>', '', '1414133063', '1414133063', '0', 'pjeupf1402729544', '挂号网“已满”、“淘宝号”慎重，网上挂号该走向哪里？', '2014-10-24', 'user');
INSERT INTO `tp_img` VALUES ('11083', '6', 'user', '如何应对煤气中毒', '2', '按期查看煤气。固然目前不少家庭开端用电磁炉炒菜，但运用煤气罐的也照样居多。因而运用煤气的家庭必然要养成按期查看管道、阀门能否有走漏的习气，烧完饭菜顺手就把煤气灶和阀门拧紧，以免一时忽略遗忘了。煤气罐到了年限必然要送去检修，避免有残次的钢瓶寄存在家里。', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f5bc2cf6e.jpg', '1', '\r\n	<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		按期查看煤气。固然目前不少家庭开端用电磁炉炒菜，但运用煤气罐的也照样居多。因而运用煤气的家庭必然要养成按期查看管道、阀门能否有走漏的习气，烧完饭菜顺手就把煤气灶和阀门拧紧，以免一时忽略遗忘了。煤气罐到了年限必然要送去检修，避免有残次的钢瓶寄存在家里。\r\n	</p>\r\n	<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		留意通风。在运用煤气时，必然要翻开窗户，坚持通风的优越。假如是用老式的燃气热水器洗澡时，门窗也不宜关死，略微留一条小裂缝，只需不直接吹到身体上惹起着凉就行。\r\n	</p>\r\n	<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		尽量不在室内烧煤炭。这个包罗烧煤炭炉取暖，以及烧炭暖锅、烧烤吃器械。必然要烧，也要放在可以通风的当地，而不是由于惧怕外界的凉风进入室内将门户紧闭。取暖时要留意人与火盆之间坚持必然的间隔，既能取暖，又不会直接吸入很多的一氧化碳。\r\n	</p>\r\n	<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		不要留老人单独取暖。老年人的年岁大，记忆不免会有些跟不上，能否有烧炭都不一定记得。再加上感官都曾经有些愚钝，即便摄入了良多的一氧化碳也未必可以很灵敏地察觉出来。因而万万不要把老人独自留在这种危机四伏的场合。\r\n	</p>\r\n	<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n		睡觉前熄灭一切炭火。曾经发作过良多起如许的惨剧，居民们为了取暖而烧了一盆炭火，后果睡觉之前忘了熄灭，以致于在睡梦中不知不觉吸入过量的一氧化碳中毒身亡。所以在上床之前，必然要把一切能够发生一氧化碳的设备都封闭，炭火都熄灭，而且开窗通风。\r\n	</p>\r\n	<table width=\"580\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;\" class=\"ke-zeroborder\">\r\n		<tbody>\r\n			<tr>\r\n				<td align=\"left\" class=\"infofont\" style=\"border:none;font-size:14px;font-family:宋体;color:#333333;\">\r\n					<br />\r\n<br />\r\n<a href=\"http://bjxhyy.hos.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<a href=\"http://zhongliu.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<a href=\"http://bjtryy.hos.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<a href=\"http://bjetyy.hos.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<br />\r\n<br />\r\n<a href=\"http://bjazyy.hos.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<a href=\"http://zhongliu.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<a href=\"http://zhongliu.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<a href=\"http://www.999120.net/disease/kq\" target=\"_blank\"></a><br />\r\n<br />\r\n<br />\r\n<a href=\"http://www.999120.net/disease/kq\" target=\"_blank\"></a><br />\r\n<br />\r\n<a href=\"http://www.999120.net/disease/kq\" target=\"_blank\"></a><br />\r\n<br />\r\n<a href=\"http://zhongliu.999120.net/\" target=\"_blank\"></a><br />\r\n<br />\r\n<a href=\"http://zhengxingmeirong.999120.net/\" target=\"_blank\"></a>\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n\r\n<table width=\"600\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;color:#000000;font-family:宋体, Verdana, Arial, Helvetica, sans-serif;font-size:12px;background-color:#FFFFFF;\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', '1414133182', '1414133182', '0', 'pjeupf1402729544', '如何应对煤气中毒', '2014-10-24', 'user');
INSERT INTO `tp_img` VALUES ('11084', '6', 'user', '小中风不可忽视要急诊', '2', '过性的局部脑缺血造成的中风，俗称小中风。小中风发作时也会有脸面麻痹、言词不清、半身不遂、视力模糊和头痛等等症状，只不过这些症状通常会在24小时之内自行消除，毛病好像不治而愈，所以许多人往往对此缺乏足够的重视，并不当即就去看急诊或者及时治疗。', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f5f424aae.jpg', '1', '<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	过性的局部脑缺血造成的中风，俗称小中风。小中风发作时也会有脸面麻痹、言词不清、半身不遂、视力模糊和头痛等等症状，只不过这些症状通常会在24小时之内自行消除，毛病好像不治而愈，所以许多人往往对此缺乏足够的重视，并不当即就去看急诊或者及时治疗。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	最近英国牛津大学的彼得罗斯威尔医师在著名外科杂志《柳叶刀》上发表文章指出，根据他的观察，如果对小中风的病人在发病的24小时之内及时处理，包括给病人服用阿斯匹灵，降低病人的血压、胆固醇，防止血栓等，这样可以降低这些病人在此后3个月内再度发生严重中风的风险。罗斯威尔医师曾对10万多人进行血管疾病的普查，他发现其中有1278名病人有中风的症状。其中600名就是上面所说的小中风。他将其中310名病人按照英国目前常规的处理办法，将病人转到门诊部医生处去就医。通常，这些病人在3周内都得到了一定的药物治疗。而对另外290名病人，他在24小时之内就给他们进行处理。结果这些病人在此后3个月发生大中风的比例只有2%。相比之下，在24小时之内没有得到及时处理的病人，在3个月内再次大中风的比例竟然高达10%。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	在另外一本《柳叶刀神经学分册》杂志上，一位来自法国巴黎的阿玛里可医生的观测，也支持了这种说法。他们对1085名在24小时之内得到处理的小中风病人进行随访的结果表明，在90天之内再次发生大中风的比例大概只有1%多一点。而根据当地医院的病史记录，小中风病人在90天之内再次中风的平均几率是6%左右。\r\n</p>\r\n<p style=\"color:#333333;font-family:宋体;font-size:14px;background-color:#FFFFFF;\">\r\n	针对这些研究成果，美国迈阿密大学神经科主任赛克博士认为，犹如胸痛对于急性<a href=\"http://ycxd.999120.net/\" target=\"_blank\">心肌梗死</a>一样，小中风对大脑缺血也是一种严重的预警信号，虽然症状可能会自行消除，但是病人和医生也应该立即采取措施，切不可掉以轻心。\r\n</p>', '', '1414133237', '1414133237', '0', 'pjeupf1402729544', '小中风不可忽视要急诊', '2014-10-24', 'user');
INSERT INTO `tp_img` VALUES ('11085', '6', 'user', '感冒了？用这几个方法科学治感冒', '2', '每到流感季节，有些人都会不幸中招，身边却总有人能“逃过一劫”。据报道，不用羡慕别人有副“百毒不侵”的好身体，只要掌握他们不感冒的秘密，你也能轻松度过流感高发期。那么，在这个气温不断下降的秋季，如果你也有感冒的迹象了，该如何科学治疗感冒呢？看看《印度时报》怎么说。', '110', '就医资讯', 'http://www.hajk.com.cn/Uploads/image/20141024/5449f8521f585.jpg', '1', '<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	每到<a href=\"http://jbk.39.net/lhxgm/\" target=\"_blank\">流感</a>季节，有些人都会不幸中招，身边却总有人能“逃过一劫”。据报道，不用羡慕别人有副“百毒不侵”的好身体，只要掌握他们不<a href=\"http://jbk.39.net/gm/\" target=\"_blank\">感冒</a>的秘密，你也能轻松度过流感高发期。那么，在这个气温不断下降的秋季，如果你也有感冒的迹象了，该如何科学治疗感冒呢？看看《印度时报》怎么说。\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	 一、备<a href=\"http://ypk.39.net/yaopin/hxxtyy/qita/aafbb.html\" target=\"_blank\">好感</a>冒药\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	家里备好止痛药，如<a href=\"http://ypk.39.net/yaopin/mianyi/ky/kfsy/adf79.html\" target=\"_blank\">布洛芬</a>，<a href=\"http://ypk.39.net/yaopin/zty/7b2cd.html\" target=\"_blank\">对乙酰氨基酚</a>和<a href=\"http://ypk.39.net/yaopin/xyxt/kxxby/b479f.html\" target=\"_blank\">阿司匹林</a>都是已知的治疗感冒的药物。市场上虽然存在着各式各样的感冒药，但基本都是以上成分，无论你选择药片，胶囊，一种可溶性片剂或一杯<a href=\"http://ypk.39.net/yaopin/c5771.html\" target=\"_blank\">冲剂</a>，这样做的最好的治疗感冒的方式。\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	 二、准备解充血药\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	解充血药可以帮助人们清理鼻窦腔，减轻大家由于感冒引起的鼻塞、呼吸不畅等症状。大多数治疗感冒和流感的药物中都会存在一定的解充血药物成分，能够起到提神醒脑的功效。但是如果你想休息，提前尽量不要服用，因为药物中兴奋的成分恐怕没有那么容易让你睡着了。\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	 三、补充锌元素\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	最近的一项研究表明，服用锌糖浆、片剂或含片能够减轻感冒患者的症状，加速感冒康复的时间。但是使用这个方法应当十分谨慎，因为长期服用可能会对人体造成<a href=\"http://jbk.39.net/keshi/zxy/zhongyi/ba267.html\" target=\"_blank\">呕吐</a>和<a href=\"http://jbk.39.net/fx/\" target=\"_blank\">腹泻</a>等不良副作用。\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	 四、时刻检查你的药箱\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	大家应该经常检查自家药箱，看看里面是否有过期的药物，或者药效作用相抵抗的作用。此外，大家也要注意服用的感冒药是否与你现在正在服用的其他药物有不良反应。如果对此有任何疑问，请向你的医生请求帮助。\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	 五、尽量不用抗生素\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	平时，大家患的感冒几乎都是由病毒感染引起，而使用抗生素绝对不会减轻感冒的症状。反而，过度使用抗生素会提高人体内细菌对抗生素的耐药性，所以抗生<a href=\"http://ypk.39.net/yaopin/d7ba1.html\" target=\"_blank\">素能</a>不用则不用，除非你真的需要它们。\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	 六、在办公桌前摆放加湿器\r\n</p>\r\n<p style=\"color:#333333;font-family:Verdana;font-size:16px;background-color:#FFFFFF;\">\r\n	加湿器能够让你的工作环境更加潮湿，吸入蒸汽可以帮助你湿润鼻子里的粘液，使它更容易通过擤鼻而排出。如果你在办公室工作，可以在桌上摆放一盆热水，或者摆放一台空气加湿器。\r\n</p>', '', '1414133843', '1414133843', '0', 'pjeupf1402729544', '感冒了？用这几个方法科学治感冒', '2014-10-24', 'user');
