INSERT INTO `tp_text` VALUES ('1', '6', '', '机构设置', '2', '江苏江阴临港经济开发区党工委、管委会共10个内设机构，均为正科级建制。\n（一）党政办公室\n    负责党工委、管委会的日常事务，检查、督办和协调党工委、管委会布置的工作；负责起草党工委、管委会的工作计划及有关文稿；负责政策研究、文书档案、机要保密、信息调研、接待、对外联络等工作；负责管委会机关的行政事务、资产管理及后勤服务工作；负责辖区内涉外事务的协调处理。\n    下设：秘书科、督查科、信息调研科、后勤服务科和综合科5个科室。\n    电话：0510-86868123\n    传真：0510-86868000\n（二）党群工作部\n    围绕党工委的中心工作，协助党工委领导抓好基层党组织建设、思想建设和党员教育工作；负责宣传落实党的统战政策，搞好统战工作；负责党工委、管委会的对外宣传工作；按干部管理权限负责干部的考察、培养、任用工作，配备好各级领导班子；负责指导和督促临港经济开发区机关各党支部和基层党组织的建章立制和“三会一课”活动；负责辖区内社会主义精神文明建设，了解和掌握基层职工群众的思想动态，开展行之有效的思想政治工作；负责做好工、青、妇等群团工作。负责办理机关及下属单位的机构编制、人事调动、劳动工资、社会保障和年度考核等事宜；负责做好机关及下属单位的离退休干部管理工作；负责拟订和统筹辖区人才发展规划，制订和执行辖区人才政策；负责做好专业技术职务的评审和工人技术等级考核的组织工作；负责辖区内出国（境）人员的政审、报批工作；负责各类人事劳动等业务的统计工作；负责人武工作。\n    下设：组织科、人事科、宣传科、统战人武科和人才服务科5个科室。\n    电话：0510-86868602\n    传真：0510-86868111\n（三）财政局（挂“国有资产监督管理办公室”、“财政国库集中收付中心”牌子）\n    负责辖区内财政收支预（决）算管理工作；各类税费的征收、监管和税收政策的落实工作；建设资金的融通、调度、筹集和资金平衡工作；按财政体制的有关规定做好与上下级财政部门的解缴和结算工作；负责机关人员工资发放工作；负责做好辖区内的会计管理工作；代表临港经济开发区管委会履行出资人的职责，负责做好对辖区国有资产的有关监督管理。\n    下设：行财综合科、预算管理科、征收管理科、经济建设科、资产管理科和财政结算中心6个科室。\n    电话：0510-86868605\n    传真：0510-86868333\n（四）经济发展局（挂“安全生产监督管理局”牌子）\n    负责编制辖区内国民经济和社会事业发展计划；负责辖区内的各类统计工作；根据管委会总体发展目标，提出一、二、三产业年度发展计划并组织实施；负责做好技术监督、物价及“三电”等工作；负责一、二、三产业的政策指导和经营管理；负责科技创新项目的申报等工作；负责做好辖区内的安全生产监督和管理工作，负责做好辖区内的环境保护和环境友好工作。\n    下设：经济运行科、优化发展科、安全监督科、环保节能科和计划管理科5个科室。\n    电话：0510-86868606\n    传真：0510-86868555\n（五）社会事业局\n    负责做好辖区内劳动社保、征地保障、职业介绍、职业培训和劳动争议调解工作；负责辖区内文教卫体、人口与计划生育、司法、法律服务、社会综合管理、政法、信访及社会稳定等工作；负责辖区内民政事业、残疾人康复就业等工作。\n    下设：劳动社保科、文化教育科、卫生计生科、信访综治科和民政科5个科室。\n    电话：0510-86868617\n    传真：0510-86868999\n（六）招商局\n     负责制订临港产业招商引资计划、外资指标任务分配方案和考核办法；负责组织开展临港产业招商活动；负责建立招商网络，捕捉项目信息，建立项目库；负责对项目信息调研、跟踪、洽谈、落实；负责做好进驻企业固定资产投资项目涉及发改、商务的审批手续；负责做好项目办理过程中的协调和服务工作。\n    下设：投资服务科、项目服务科、招商一科、招商二科、招商三科和招商四科6个科室。\n    电话：0510-86868618\n    传真：0510-86868800\n（七）规划建设局\n    负责做好辖区内总体规划的执行及组织各专项规划的编制工作；负责做好新建、改建、扩建项目的规划选址、定点、项目建设规划设计方案、基础设施建设规划设计方案的有关工作；负责做好建设用地规划许可证和建设工程规划许可证的有关工作。负责做好辖区内建设工程的招投标管理、建筑市场及各类建设工程的施工管理工作；负责做好辖区内房屋拆迁政策和安置工作；负责做好各项公用事业的管理、环境卫生、创建、综合治理工作；负责做好绿化、道路、桥梁、管线、路灯、供水、排污等工程的组织实施及管理工作。\n    下设：公用事业科、规划管理科、建设服务科、工程管理科、动迁安置科和安置房建设科6个科室。\n    电话：0510-86868608\n    传真：0510-86868666\n（八）港口发展局\n    以港口为核心通过评估港口未来发展需求制订港口发展策略；协助做好辖区内港口总体规划和控制性详规的编制及申报工作；组织和协调港口内外贸货物运输，研究分析辖区内市场货物流向和发展态势；建设和完善港航平台，推进口岸区域通关，研究、制订各类有利于发展港口的优惠政策和措施并组织实施，积极争取政策支持以促进航线航班的开辟及市场拓展；引进国际国内港口物流相关企业入驻辖区，研究新型物流交易模式及供应链理念，促进港口向具有商务、信息、分拨功能的新型港口转型发展。\n    下设：港航促进科、物流招商科、规划建设科和投资服务科4个科室。\n    电话：0510-86868901\n    传真：0510-86868900\n（九）农村工作局\n    负责辖区“三农”相关工作。贯彻执行党在农村的路线方针政策和国家相关法律法规，拟定实施行政村经济社会发展规划和具体政策措施；加强农业、农村和农民服务功能，完善农业社会化服务体系和农村合作组织，改善农业发展环境，推进农业产业结构调整，发展村级集体经济；负责指导监督村级集体资产管理工作，参与村级财务、审计、统计工作。\n    下设：农村发展科、水利农业科和集体资产管理科3个科室。\n    电话：0510-86868067\n    传真：0510-86868065\n（十）便民服务中心（挂“企业服务中心”牌子）\n    负责辖区便民服务、企业服务相关工作。负责做好政府授权或相关职能部门委托的行政许可事项；监管、督促行政职能部门所有行政许可和非行政许可项目进驻一站式服务大厅；扎口管理有关非行政许可项目和便民服务事项；配合相关部门清理、规范行政许可和非行政许可事项；制订各项行政服务制度和管理办法，并对进驻窗口及其工作人员实行日常管理和考核；牵头组织、协调有关重大审批“绿色通道”项目的联审联办；组织有关部门对需要由两个及两个以上部门办理的行政审批事项进行会商并集中办理；会同相关部门拟定行政服务体制发展规划并对涉及行政许可的职能部门实施管理；做好12345便民服务工作。\n    下设：业务科、考核科和综合科3个科室。\n    电话：0510-86868090\n    传真：0510-86868098\n    另按有关规定设置纪工委（挂“监察审计局”牌子），主要职责：\n    加强对党的路线、方针、政策、决议和国家法律法规及党工委、管委会发展战略、重大决策部署贯彻执行情况的检查。协助党工委、管委会加强党风廉政建设和组织协调反腐败工作，切实加强党风廉政教育，健全权力运行制约监督机制；负责相关信访办理和案件查处工作；加强效能监察，营造良好发展环境。负责党工委、管委会及所属各单位（部门）财政预算执行、其它财政收支情况和预算外资金的管理、使用情况的审计；负责所属国有（集体）企业、国有（集体）控股企业和国有（集体）资产占主导地位企业的资产、负债和损益审计；负责有关领导干部任期经济责任审计。负责村级集体资产的审计监督。负责本级财政性资金、政府专项资金（基金）、政府统一借贷资金等投资建设项目的标底（预算）、施工现场跟踪和竣工结算实施审计监督；负责党工委、管委会组织或委托实施拆迁涉及补偿资金的审计监督；负责辖区基本建设项目审计质量的监督和管理。\n    下设：纪检科、监察科、财经审计科和基本建设审计科（挂“政府投资项目审计中心”牌子）4个科室。\n    电话：0510-86868603\n    传真：0510-86868222\n    按照有关法律、法规和政策规定设置群团组织机构。\n \n临港经济开发区下属事业单位\n1．江阴临港经济开发区国际商务中心（挂“江苏江阴软件园管委会”牌子）\n    主要参与制订临港经济开发区核心区、中央商务区招商引资、项目建设和区域管理的有关政策；负责临港经济开发区核心区、中央商务区的招商引资工作；负责临港经济开发区核心区、中央商务区重大经贸活动组织和区内重点项目的推介、跟踪、服务工作；负责做好二次招商项目的接待、洽谈，做好入驻企业的注册、入驻协调工作，并定期做好入驻企业销售、税收等各项统计工作；负责做好临港经济开发区核心区、中央商务区前期规划、国土资料以及各地块挂牌的各项事宜；协助做好入驻项目在规划、国土、建设等方面各项手续的报批、报建工作；协助做好区域内安全生产工作，做好管辖区域事故统计、上报工作，并配合市级安全生产事故调查组参与事故调查；负责抓好临港经济开发区核心区、中央商务区内公共物业管理，督促做好环境卫生、户外广告等工作；负责贯彻实施国家、省、市发展软件产业的法律、法规和有关规定，落实发展软件产业的各项优惠政策，在园区创造发展软件产业的良好环境；承办临港经济开发区党工委、管委会交办的其他事项。\n    下设：招商一科、招商二科、项目服务科３个科室。\n    电话：0510-86868639\n    传真：0510-86868865\n2．江阴长江港口综合物流园区管委会\n    主要负责组织制订并实施园区发展规划和开发建设计划；负责园区内的招商引资工作；负责园区财政收支预决算及组织管理工作；负责管理和经营园区国有资产，确保其保值增值；负责管委会的财务管理和投融资工作；负责入园项目的把关，项目投资合同的签订，园区内项目合同履约及建设的管理；依法保障园区企业自主经营，为园内企业提供服务，创造良好的招商引资发展环境；负责做好园区内企业的统计及经济运行分析等工作；承办江阴临港经济开发区党工委、管委会交办的其他事项。\n    下设：综合管理科、招商发展科、园区服务科３个科室\n    电话：0510-86023001\n    传真：0510-86023000\n3．江阴市保税物流中心\n    主要负责本中心内的招商引资、招商揽货工作；负责综合保税区申报工作；负责做好中心内招商引资、入驻企业的开票销售、税金、监管货值、报关单量、统计等服务和管理工作；负责与海关、国检、各业务单位沟通协调；负责做好仓储管理，包括出租、仓内货物管理以及安全操作管理等工作；承办江阴临港经济开发区党工委、管委会交办的其他事项。\n    下设：综合服务科、招商发展科、市场运管科３个科室\n    电话：0510-81651601\n    传真：0510-81651611\n4．江阴临港经济开发区政府投资项目审计中心和江阴临港经济开发区财政国库集中收付中心\n    临港新城国家建设项目审计中心更名为江阴临港经济开发区政府投资项目审计中心，临港新城财政国库集中收付中心更名为江阴临港经济开发区财政国库集中收付中心。更名后，政府投资项目审计中心和财政国库集中收付中心2家事业单位不实际运转，其职责分别整合到纪工委（挂“监察审计局”牌子）、财政局，其机构、事业编制保留，原在编人员由临港经济开发区管委会统一调配使用。', '1402741917', '1402741917', '0', 'pjeupf1402729544');
